import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';  // Import React Router components
import Login from './components/Login';  // Import Login component
import Home from './components/Home/Home';  // Import Home component
import GovernmentServices from './components/GovernmentServices/GovernmentServices';  // Import GovernmentServices component

const App = () => {
  return (
    <Router>
      <Switch>
        {/* Route for Login page */}
        <Route path="/login" exact component={Login} />

        {/* Route for Home page */}
        <Route path="/home" exact component={Home} />

        {/* Route for Government Services page */}
        <Route path="/government-services" exact component={GovernmentServices} />

        {/* Default Route for Login (if users visit root '/'), make sure Login page is accessible at '/' */}
        <Route path="/" exact component={Login} />
      </Switch>
    </Router>
  );
};

export default App;
